import { createRouter, createWebHashHistory } from "vue-router";
import CharacterOverview from "../views/CharacterOverview.vue";
import Kompendium from "../views/kompendium/Kompendium.vue";
import DashBoard from "../views/Dashboard.vue";
import Login from "../views/Login.vue";
import Register from "../views/Register.vue";
import Home from "../views/Home.vue";
import Account from "../views/Account.vue";

import AccountOverview from "../views/account/AccountOverview.vue";
import AccountEdit from "../views/account/AccountEdit.vue";
import PasswordReset from "../views/account/PasswordReset.vue";
import AccountSubscriptions from "../views/account/AccountSubscriptions.vue";

import Cookies from "../views/legal/Cookie.vue";
import Imprint from "../views/legal/Imprint.vue";
import Privacy from "../views/legal/Privacy.vue";

import CharacterTool from "../views/CharacterTool.vue";
import CharacterIntro from "../views/charactertool/Intro.vue";
import StepOne from "../views/charactertool/StepOne.vue";

import Categories from "../views/kompendium/Categories.vue";

import Talents from "../views/kompendium/Talents.vue";
import Spells from "../views/kompendium/Spells.vue";
import Classes from "../views/kompendium/Classes.vue";

import Barbar from "../views/kompendium/classes/Barbar.vue";

const routes = [
  {
    path: "/",
    name: "Home",
    component: Home,
  },
  {
    path: "/login",
    name: "Login",
    component: Login,
  },
  {
    path: "/register",
    name: "Register",
    component: Register,
  },
  {
    path: "/dashboard",
    component: DashBoard,
    children: [
      {
        path: "/kompendium",
        name: "Kompendium",
        component: Kompendium,
        redirect: "/kompendium/categories",
        children: [
          {
            path: "categories",
            name: "Categories",
            component: Categories,
          },
          {
            path: "talents",
            name: "Talents",
            component: Talents,
          },
          {
            path: "spells",
            name: "Spells",
            component: Spells,
          },
          {
            path: "classes",
            name: "Classes",
            component: Classes,
          },
        ],
      },
      {
        path: "/kompendium/classes/barbar",
        name: "Barbar",
        component: Barbar,
      },
      {
        path: "/characters",
        name: "CharacterOverview",
        component: CharacterOverview,
      },
      {
        path: "/characters/new",
        name: "CharacterTool",
        component: CharacterTool,
        redirect: "/characters/new/intro",
        children: [
          { path: "intro", name: "CharacterIntro", component: CharacterIntro },
          { path: "1", name: "StepOne", component: StepOne },
        ],
      },
      {
        path: "/cookies",
        name: "Cookies",
        component: Cookies,
      },
      {
        path: "/privacy",
        name: "Privacy",
        component: Privacy,
      },
      {
        path: "/imprint",
        name: "Imprint",
        component: Imprint,
      },
      {
        path: "/account",
        name: "Account",
        component: Account,
        redirect: "/account/overview",
        children: [
          {
            path: "overview",
            name: "AccountOverview",
            component: AccountOverview,
          },
          {
            path: "edit",
            name: "AccountEdit",
            component: AccountEdit,
          },
          {
            path: "subscriptions",
            name: "AccountSubscriptions",
            component: AccountSubscriptions,
          },
          {
            path: "resetpassword",
            name: "PasswordReset",
            component: PasswordReset,
          },
        ],
      },
    ],
  },
];

const router = createRouter({
  history: createWebHashHistory(),
  routes,
  linkActiveClass: "active",
});

export default router;
